import ".././styles/livefeedpage.css";
import Box from '@mui/material/Box';
import Slider from '@mui/material/Slider';
import React, { useState, useEffect } from 'react';
function handleClick() {
    const [data, setData] = useState(null);
    const xhr = new XMLHttpRequest();
    xhr.open('GET', '​​https://camera.beehivemonitoringscu.lol/?view=full');
    xhr.onload = function() {
        if (xhr.status === 200) {
            setData(JSON.parse(xhr.responseText));
        }
    };
      xhr.send();
}
function valuetext(value) {
    console.log(value)
    return `${value}`;
  }
const marks = [
    {
      value: -2,
      label: '-2',
    },
    {
      value: -1,
      label: '-1',
    },
    {
      value: 0,
      label: '0',
    },
    {
      value: 1,
      label: '1',
    },
    {
        value: 2,
        label: '2',
      },
  ];  
  const clockcycle = [
    {
      value: 3,
      label: '3',
    },
    {
      value: 4,
      label: '4',
    },
    {
      value: 5,
      label: '5',
    },
    {
      value: 6,
      label: '6',
    },
    {
        value: 7,
        label: '7',
      },
      {
        value: 8,
        label: '8',
      },
      {
        value: 9,
        label: '9',
      },
      {
        value: 10,
        label: '10',
      },
      {
        value: 11,
        label: '11',
      },
      {
          value: 12,
          label: '12',
        },
    {
        value: 13,
        label: '13',
    },
    {
        value: 14,
        label: '14',
    },
    {
        value: 15,
        label: '15',
    },  
  ]; 
  

 
const LiveFeedpage = () => {
    return (
        <div class ="viewpoint">
            {handleClick()}
            <h1 class="title">Live Feed</h1>
            <div class="bord">
                <div class="stream">
                <button onClick={handleClick}>Get Data</button>
                {data ? <div>{JSON.stringify(data)}</div> : <div>Loading...</div>}
                </div>
            </div>
            <div class="LED Box">
                <Box sx={{ width: 300 }}>
                    <Slider
                        aria-label="LED Intensity"
                        defaultValue={0}
                        getAriaValueText={valuetext}
                        valueLabelDisplay="auto"
                        shiftStep={1}
                        step={1}
                        min={0}
                        max={100}
                    />
                </Box>
            </div>
            <div class="Brightness Box">
                <Box sx={{ width: 300 }}>
                    <Slider
                        aria-label="Custom marks"
                        defaultValue={0}
                        getAriaValueText={valuetext}
                        step={1}
                        valueLabelDisplay="auto"
                        min={-2}
                        max={2}
                        marks={marks}
                        color=""
                    />
                </Box>
            </div>
            <div class="ClockCycle">
                <Box sx={{ width: 300 }}>
                        <Slider
                            aria-label="Custom marks"
                            defaultValue={6}
                            getAriaValueText={valuetext}
                            step={1}
                            valueLabelDisplay="auto"
                            min={3}
                            max={15}
                            marks={clockcycle}
                            color="secondary"
                        />
                    </Box>
            </div>
        </div>
        
    );
};
export default LiveFeedpage;
